import React from 'react';

function Contact() {
  return (
    <div className="contact">
      <h3>Contact</h3>
      <p><strong>E-mail</strong> | pbh7080@gmail.com</p>
      <p>
        <strong><a href="https://www.linkedin.com/in/bohyeon-park-3a79611b6/">Linkedin</a></strong> |
        <strong><a href="https://www.instagram.com/brynnee.park/">Instagram</a></strong> |
        <strong><a href="https://github.com/brynnPark">Github</a></strong>
      </p>
    </div>
  );
}

export default Contact;
